				ИЛИ Объект.ИзменяемыеОбъекты.НайтиСтроки(Новый Структура(""БлокироватьИнтерфейс"", Истина)).Количество() > 0) Тогда
		Отметка = Ложь;
	КонецЕсли;

	Элементы.ПроцедураПроверки.ОтметкаНезаполненного = Отметка;

