	Приоритеты.Вставить(""БизнесПроцессы"", 70);
	Приоритеты.Вставить(""РегистрыСведенийНезависимые"", 80);
	Приоритеты.Вставить(""Документы"", 90);
	Приоритеты.Вставить(""ЖурналыДокументов"", 100);
